import React, { useState, useEffect } from 'react'
import { Container } from '../styled/layoutStyle'
import firebase from '../config'


function History() {
  const [History, setHistory] = useState([]);
  const [Loading, setLoading] = useState(false);
  const firebaseRef = firebase.firestore().collection("History");

  useEffect(() => {
    function getHistory() {
      setLoading(true);
      firebaseRef.get().then((item) => {
        const items = item.docs.map((doc) => doc.data());
        setHistory(items);
        setLoading(false);
      });
    }
    getHistory();
  }, []);
  console.log(History);


  const renderHistory = () => {
    return History.map((item, i) => {
      return (
        <Container key={i}>
          <table>
            <tr>
            <th scope="col">#</th>
            <th scope="col">Start</th>
            <th scope="col">End</th>
            <th scope="col">Avatar</th>
            </tr>


          </table>
          <div> start : {item.start}</div>
          <div>end : {item.end}</div>
          <div>prime count : {item.cntprime}</div>
          <div>prime number : {item.prime}</div>

      

        </Container>
      );
    });
  };

  return (

    <Container>
      <h1>History</h1>
      <div>{renderHistory()}</div>
    </Container>
  )
}

export default History
